function ProductList (props){
    
return(
    <div className="col-md-4">
      <div className="card" >
        <div className="card-header">
         <img src={props.img}/></div>

    <div className="card-body">
       <h2>{props.name}</h2>

        
    </div>
 </div>
 </div>
);
}
export default ProductList
